import { getTicketsData } from "../actions"

export const fetchSearchId = () => {
  return dispatch => {
    fetch('https://aviasales-test-api.kata.academy/search')
      .then(response => response.json())
      .then(res => {
        console.log('id: ', res);
        return fetch(`https://aviasales-test-api.kata.academy/search${res.searchId}`)
  })
      .then(data => data.json())
      .then(json => {
        console.log(json)
        dispatch(getTicketsData(json))
      })
  }
}
